import React, { Fragment } from "../node_modules/react";
import GeoLocation from "../../util/geoLocation";
import AppContainer from "../AppContainer";

const App = ({ lat, lng }) => {
  return (
    <Fragment>
      <AppContainer lat={lat} lng={lng} />
    </Fragment>
  );
};

export default GeoLocation(App);
